import React from 'react';
import SearchBar from "./searchBar";


class App extends React.Component{

    getAction(event){
        console.log(event+" on Action");

    }
    render(){
        return (<div className="ui container" ><SearchBar onAction={this.getAction} /></div>);
    }
}

export default App;
